import React, { useEffect, useState } from "react";
import api from "../../../api";

export default function UsersList() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    api.get("/admin/getUsers").then((res) => setUsers(res.data.data));
  }, []);

  return (
    <div className="users-container">
      <h2>All Users</h2>
      <table className="users-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Email</th>
            <th>Enabled</th>
            <th>Role</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.id}</td>
              <td>{user.email}</td>
              <td>{user.enabled ? "✅" : "❌"}</td>
              <td>{user.role}</td>
              <td>{user.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
